    <meta name="viewport" content="width=device-width">
    <title>Microsoft Stream</title>
    <style>
        #streamLoading {
            position: absolute;
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            background: white;
            z-index: 99;
        }

            #streamLoading .loading-spinner {
                background: url("../../../bundles/app/generated/stream-loading.png");
                width: 170px;
                height: 75px;
                animation: play 1.5s steps(48) infinite;
                margin: 0;
            }

        #browserError, #CompatibilityViewError {
            padding: 15px;
            box-sizing: border-box;
            height: 100vh;
            width: 100%;
            display: none;
            position: absolute;
            left: 0;
            top: 0;
            background-color: #212121;
            color: #ffffff;
            font-family: SegoeUI, 'Stream Segoe UI', 'Helvetica Neue', Helvetica, Arial, sans-serif;
        }

            #browserError .error-title, #CompatibilityViewError .error-title {
                font-size: 25px;
            }

            #browserError .error-message, #CompatibilityViewError .error-message {
                margin-top: 10px;
                font-size: 16px;
            }

            #browserError a, #CompatibilityViewError a {
                text-decoration: underline;
            }

                #browserError a:active, #CompatibilityViewError a:active {
                    color: #A19F9D;
                }

                #browserError a:hover, #CompatibilityViewError a:hover {
                    color: #BEBBB8;
                }

                #browserError a:link, #CompatibilityViewError a:link, #browserError a:visited, #CompatibilityViewError a:visited {
                    color: #D2D0CE;
                }

            #browserError .error-button-container, #CompatibilityViewError .error-button-container {
                margin-top: 20px;
            }

            #browserError button, #CompatibilityViewError button {
                background-color: #c20052;
                border: none;
                color: #ffffff;
                height: 32px;
                border-radius: 2px;
                font-size: 14px;
                padding: 0 22px 0px;
                cursor: pointer;
                font-weight: 600;
            }

        [id^="adal"] {
            display: none;

    var extractHostname = function(url) {
